import React from 'react'

class Result extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      stag: [5, 2, 2, 2],
      otter: [3, 1, 3, 3],
      doe: [2, 2, 2, 2],
      phoenix: [3, 4, 1, 3],
      wolf: [5, 5, 3, 2],
      cat: [5, 2, 5, 5],
      horse: [5, 3, 5, 1],
      newScore: []
    }
  }

  result() {
    let userScore = this.prop.userScore
    let newScore = userScore.map(function(item, index){
      return item - this.state.stag[index]
    })
    this.setState({
      newScore: newScore
    })
  }

  render() {
    return(
      <h3>{this.props.userScore} {this.state.newScore}</h3>
    )
  }
}

export default Result
